INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (30801, 'El hijo de rostro pálido', 'Continuación de "The Paleface" (1948), de Norman Z. McLeod, tambien con Hope y Russell y coescrita por Tashlin, uno de los grandes éxitos de taquilla del actor Bob Hope (sin Bing Crosby). En el film, Hope y Jane Russell repiten protagonismo, uniéndose esta vez el cantante y actor Roy Rogers. Lo curioso es que sus personajes son diferentes, ya que ahora Hope es un universitario que viaja al salvaje Oeste para hacerse cargo de la herencia de su padre, un célebre pistolero. En su camino se topará con extraños personajes como un agente federal (Rogers) y una chica de salón que tiene una doble personalidad como bandida.', 'https://image.tmdb.org/t/p/original/zEHHFRw4axerMQTRXixoLcyO0Eh.jpg', 'https://image.tmdb.org/t/p/original/3TmRl1fhY3DH0ZN4c4dMrggyKAt.jpg', '', 1952, 95);
